class Solution:
    def preorderTraversal(self, root: TreeNode) -> List[int]:

        preorder = []
        if root is None:
            return preorder

        s = [root]
        while len(s) > 0:
            node = s.pop()
            preorder.append(node.val)
            if node.right is not None:
                s.append(node.right)
            if node.left is not None:
                s.append(node.left)

        return preorder

