class Solution:
    def evalRPN(self, tokens: List[str]) -> int:

        def comp(or1, op, or2):
            if op == '+':
                return or1 + or2

            if op == '-':
                return or1 - or2

            if op == '*':
                return or1 * or2

            if op == '/':
                abs_result = abs(or1) // abs(or2)
                return abs_result if or1 * or2 > 0 else -abs_result

        stack = []

        for token in tokens:
            if token in ['+', '-', '*', '/']:
                or2 = stack.pop()
                or1 = stack.pop()
                stack.append(comp(or1, token, or2))
            else:
                stack.append(int(token))

        return stack[0]

