class Solution:
    def maxSlidingWindow(self, nums: List[int], k: int) -> List[int]:

        N = len(nums)
        if N * k == 0:
            return []

        if k == 1:
            return nums[:]

        # define a max queue
        maxQ = collections.deque()

        result = []
        for i in range(N):
            if maxQ and maxQ[0] == i - k:
                maxQ.popleft()

            while maxQ and nums[maxQ[-1]] = k - 1:
                result.append(nums[maxQ[0]])

        return result

